    computed: {
        //模糊查询(同步方法)
        promptMessage: function () {
            var self = this;
            var suggestionList = [];
            //如果输入框为空，且缓存没有数据，第一次查询所有线路。第二次走缓存
            if(self.suggestionListLines.length) {
                suggestionList = self.suggestionListLines;
            } else{
                var url = this.contextPath + "/carLine/queryCarNos";
                suggestionList = $.ajax({url: url, async: false, dataType: "json"}).responseText;

                //如果 所有线路也为空， 输入框为空，查询所有线路存入缓
                if(!self.suggestionListLines.length) {
                    self.suggestionListLines = JSON.parse(JSON.stringify(suggestionList));
                }
            }
            return suggestionList;
        },
    },
    methods: {
        getContextPath: function () {
            var contextPath = document.location.pathname;
            var contextPath = contextPath.split('/')[1];
            var contextPath = "/" + contextPath;
            this.contextPath = contextPath;
        },
        handleNodeClick:function(data, nodeValue, node){//选中车牌号改变
            let self = this;
            //判断是否是叶子节点，如果是走ajax，不是直接return
            for(let n in data) {
                if(n == 'children'){
                    return;
                };
            }
            //查询对应车牌号的经纬度
            self.searchInput = data.label.split(" ")[0];//获得车牌号
            this.$refs.tree.setCheckedKeys([data.id]);//选中标签
            this.searchPathByCarNo();
        },
        //模糊查询
        querySearchAsync(queryString, cb) {
            var self = this;
            let promptMessage = this.promptMessage ? this.promptMessage : [];
//          promptMessage = JSON.parse(promptMessage);
            var results = queryString ? promptMessage.filter(this.createFilter(queryString)) : promptMessage;
            if (results.length > 8) {
                results = results.slice(0, 8);
            }
            // 调用 callback 返回建议列表的数据
            // clearTimeout(this.timeout);
            // this.timeout = setTimeout(() => {
            cb(results);
            // }, 3000 * Math.random());
        },
        createFilter(queryString) {
            return (promptMessage) => {
                //取 >= 0 类似模糊查询 %%
                return (promptMessage['car_no'].toLowerCase().indexOf(queryString.toLowerCase()) >= 0);
            };
        },
        handleSelect: function (item) {
            let self = this;
            this.searchInput = item['car_no'];
            // let nodes = this.$refs.tree.getCheckedNodes();
            // if (nodes && nodes.length) {
            //     for (let i = 0; i < nodes.length; i++) {
            //         self.$refs.tree.getNode(nodes[i]).collapse();
            //     }
            // }

            let id = '', flag = false;
            function traverseTree(node) {
                if (!node) {
                    return;
                }
                //找到跳出
                if (node && node.label && (node.label == item['car_no'])) {
                    id = node.id, flag = true;
                    return;
                }
                if (node.children && node.children.length > 0) {
                    var i = 0;
                    for (i = 0; i < node.children.length; i++) {
                        traverseTree(node.children[i]);
                    }
                }
            }
            self.carNos.forEach(function (item, index) {
                if (!flag) {
                    traverseTree(item);
                }
            })

            self.defaultExpandedKeys = [id];//打开展开树
            self.$refs.tree.setCheckedKeys([id]);//选中树
            // self.$nextTick(function () {
            //     var div_top = self.$refs[id].offsetTop;
            //     self.$refs.tree1.scrollTop = (div_top - 52);
            // });
            setTimeout(function () {//暂时用异步的处理
                var div_top = self.$refs[id].offsetTop;//获得举例顶部的距离
                self.$refs.tree1.scrollTop = (div_top - 52);//定位滚动条
            }, 300)
        },
    },
